import React from 'react';
import './Login.css';
import { useState, useEffect} from 'react';
// import { useNavigate } from 'react-router-dom';

const Login = (porps) => {

  const [posts, setPosts] = useState([]);

   useEffect(() => {
      fetch('http://26.90.237.200:3000/login')
         .then((res) => res.json())
         .then((data) => {
            console.log(data);
            setPosts(data);
         })
         .catch((err) => {
            console.log(err.message);
         });
   }, []);

  
